import React from "react";
import Aux from "./Auxliliary/Auxiliary";


const Card = (props) => {
  return (
    <Aux>
      <div className="div1">
        <h1>{props.head1}</h1>
        <span
          src={props.imgsrc}
          alt="this is a"
          className="img"> </span>
        <p>Hello! The world is beuatiful</p>
        <button>Click me</button>
      </div>
    </Aux>
  );
};

export default Card;
